import axios from 'axios';
import './Login.css';
import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Accordion, AccordionSummary, AccordionDetails, Typography } from '@mui/material';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

function UserHistory() {
  const [data, setData] = useState([]);
  const [email, setEmail] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (userEmail) {
      setEmail(userEmail);
    }
  }, []);

  useEffect(() => {
    if (email) {
      fetchData();
    }
  }, [email]);

  const fetchData = async () => {
    try {
      const response = await axios.get(`http://localhost:3001/userHistory?Email=${email}`);
      setData(response.data);
    } catch (error) {
      console.error("Error", error);
    }
  };

  const handleClick = () => {
    navigate('/');
    localStorage.removeItem('userEmail');
  };

  return (
    <>
      <header>
        <Link to="/" className="logo"><h2>GlucoWise</h2></Link>
        <nav className="navigation">
          <Link to="/">Home</Link>
          <Link to="/userHistory">User History</Link>
          <Link to="#">Feedback</Link>
          <Link to="#">About</Link>
          <button onClick={handleClick} className="loginbtn">Logout</button>
        </nav>
      </header>
      <div>
        {data.map((item, index) => (
          <Accordion key={index}>
            <AccordionSummary
              expandIcon={<ExpandMoreIcon />}
              aria-controls={`panel-${index}-content`}
              id={`panel-${index}-header`}
            >
              <Typography>Entry {index + 1}</Typography>
            </AccordionSummary>
            <AccordionDetails>
              <div>
                <p>Diabetes in Heredity: {item.Heredity === 1 ? 'Yes' : 'No'}</p>
                <p>Duration of Physical Activity: {item.PhysicalActivity} minutes</p>
                <p>Frequency of Fast Food: {item.FastFood}</p>
                <p>Glucose level: {item.Glucose} mg/dL</p>
                <p>Blood Pressure level: {item.BloodPressure} mmHg</p>
                <p>BMI: {item.BMI} kg/m2</p>
                <p>Age: {item.Age} years</p>
                <p>Prediction: {item.Outcome} %</p>
              </div>
            </AccordionDetails>
          </Accordion>
        ))}
      </div>
    </>
  );
}

export default UserHistory;
